import React, { useState } from "react";

const App = () => {
  const [count, setCount] = useState(0);
  return (
    <div>
      <h1>{count}</h1>
      <button setCount={(cout) => cout++}>Increase</button>
      <button setCount={(cout) => cout--}>Decrease</button>
    </div>
  );
};

export default App;
